import "../../../css/Admin/upload-proyect.css";

export function UploadProyect() {

    return(
        <>
        <div className="information-header">
                <h2 className="title-header">Subir Proyecto</h2>
            </div>
        <div className="container-principal">
            <div className="proyect">
                <img src="../img/img-test/image-7.png" alt="proyecto" className="img-proyect"></img>
                <p className="txt-proyect">Apartamento Suba</p>
            </div>  
        </div>
        </>
    )
    
}
